import React, { Component }  from "react";
import '../css/SocialContact.css'
import {ReactComponent  as  FacebookLogo} from './facebook.svg';
import {ReactComponent  as  GitHubLogo} from './github.svg';
import {ReactComponent  as  PhoneLogo} from './phone.svg';
import {ReactComponent  as  TelegramLogo} from './telegram.svg';
import {ReactComponent  as  TwitterLogo} from './twitter.svg';
const SocialContact = ()=>{
    return (
        <div className='social-contact'>
            <a href="https://www.facebook.com/allenwalker1106/" target='_blank'>
                <FacebookLogo className='social-logo'/>

            </a>
            <a href="https://github.com/allenwalker1106" target="_blank">
                <GitHubLogo className='social-logo'/>
            </a>
            <a href="tel:033-491-073-8" tooltip>
                <PhoneLogo className='social-logo'/>
            </a>
            <a href= "https://telegram.me/coldblood101" target="_blank">
                <TelegramLogo className='social-logo'/>
            </a>
            <a href="https://twitter.com/allenwalker1106" target="_blank">
                <TwitterLogo className='social-logo'/>
            </a>
            <p> Social Contact </p>
            <p>------------------------------------</p>
        </div>
    );
}

export default SocialContact;
